import { Container, Row, Col } from 'react-bootstrap';
import { getGameList } from '../../actions/rawg-api';
import '../../scss/browse_page/browse_page.scss';

export default class BrowsePage extends Component {
  constructor() {
    super();
    this.state = {};
  }

  componentDidMount() {
    console.log('browse mounted');
    const games = getGameList('genre', 'adventure');
    console.log(games);
  }

  render() {
    return (
      <Container className="w-100 py-5" id="browse-container">
        <Row>
          <Col>
            <div>
              <p>Sort By: Release Date</p>
            </div>
          </Col>
          <Col lg={2} xs={12}>
            <div className="bottom-border pb-2">
              <p>Filters</p>
            </div>
          </Col>
        </Row>
        <Row>
          <Col>games go here</Col>
          <Col></Col>
        </Row>
      </Container>
    );
  }
}
